import React from 'react';


import './Project.scss';
import imgGame from '../../assets/png/boat-vs-submarine';
import imgWeb from '../../assets/png/imgWebPersonal';

export default function Project() {
    return (
        <div>
            {MyProject.map(item => <div>
                <h2>{item.title}</h2>
                <img src={item.img} alt={item.title} style={{width:'300px'}}/>
            </div>)}
        </div>
    )
}

const MyProject = [
    {
        title: 'Movies-ddf',
        img: 'https://user-images.githubusercontent.com/60430655/96006957-50207e00-0e3e-11eb-9269-46340d69ac2a.png',
        description: 'Single page aplication de información de películas, series y actores, creada con Reactjs, nodejs, javaScript, bootstrap y API`s',
        url: 'https://movies-ddf.herokuapp.com'
    },
    {
        title: 'Clash-royale',
        img: 'https://user-images.githubusercontent.com/60430655/94181067-3c1cd880-fe9f-11ea-828d-0326946ecdc7.png',
        description: 'Aplicación creada en back con express, nodejs, ajax y API`s y Handlebars para el front. Realizada junto a una compañera del bootcamp. Aplicacion para ver estadisticas de juegos y CRUD de usuario para agregar cartas a tu mazo. Enalace a tu perfil de juego para conocer tus estadisticas.',
        url: 'https://github.com/scmoreira/Clash-Royale-Project'
    },
    {
        title: 'Boat vs Submarine',
        img: {imgGame},
        description: 'Juego de submarinos contra barco, las eliminaciones dan más puntuacion y los peces te quitan puntos. El juego',
        url: 'https://daviddiaz-github.github.io/Boat_Submarines/'
    },
    {
        title: 'Web Personal',
        img: {imgWeb},
        description: 'Web Personal creada mediante un curso de udemy. Realizada con stack MERN, Hooks y Ant-desing.',
        url: 'https://eloquent-villani-3d205e.netlify.app'
    }
];
